import React from "react";
import { Link } from "react-router-dom";
import "./style.css";
import Logo from "../Logo";
import Info from '@material-ui/icons/Info';
import Laptop from '@material-ui/icons/Laptop';


// Depending on the current path, this component sets the "active" class on the appropriate navigation link item
function Navbar() {
  return (
    <nav 
    className="navbar navbar-expand-lg navbar-light"
    style={{backgroundColor:'#BFBDC1'}}
    >
      <Logo style={{
        flex: 1,
        padding: 0,
        height: '80px',
      }}/>
      <div 
      className="navbar-brand" 
      to="/"
      style={{
        flex: 1,
        padding: 'none',
        height: '160px',
        marginTop: 0,
      }}
      >
      <text style={{  
        flex: 1,      
        fontSize:'90px',
        fontWeight:400,
        color: '#6D6A75',
        marginLeft: '10px',
        marginBottom: '-50px',
        fontFamily: 'Source Sans Pro, sans-serif',
        textShadow: '3px 3px WHITE',}}>Richard Antolin</text><br/>
        <text style={{
          marginTop: '100px',
          color: 'white',
          marginLeft: '15px',
          fontSize:'20px',
          textShadow: '2px 2px #white',
          flex: 1,
        }}>Full Stack Web Developer/UX Engineer</text>
      </div>


      <div>
        <ul className="navbar-nav"
            style={{
              marginLeft: "50px",
              marginTop: "30px",
            }}
                      >
          <li className="nav-item">
            <Link
              className= "Iconbuttons"
              style={{
                fontFamily: 'Montserrat, sans-serif',
                fontSize: '18px',
                fontWeight:400,
                color: "white",
                backgroundColor: '#DE9E36',
                borderRadius: '8px 0px 8px 0px',
                boxShadow: '3px 3px',
                textAlign: 'center',
                width: '150px',
                padding: '10px',
                marginRight: '50px',
                marginTop: '90px'
              }}
              to="/"
              className={
                window.location.pathname === "/" || window.location.pathname === "/about"
                  ? "nav-link active"
                  : "nav-link"
              }
            >
              About
            <Info style={{fontSize:'30px', marginLeft:'10px'}}/>
            </Link>
          </li>
          <li className="nav-item">
            <Link
              style={{
                fontFamily: 'Montserrat, sans-serif',
                fontSize: '18px',
                fontWeight:400,
                color: "white",
                backgroundColor: '#DE9E36',
                borderRadius: '8px 0px 8px 0px',
                boxShadow: '3px 3px',
                textAlign: 'center',
                width: '150px',
                padding: '10px',
                marginRight: '50px',
                marginTop: '90px'
              }}

              to="/portfolio"
              className={window.location.pathname === "/portfolio" ? "nav-link active" : "nav-link"}
            >
              Portfolio
            <Laptop style={{fontSize:'30px', marginLeft:'10px'}}/>
            </Link>
          </li>
          <li className="nav-item">
          </li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
